import { useState } from 'react';
import "./App.css";

function Login() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleEmailChange = (e) => {
    setEmail(e.target.value);
  };

  const handlePasswordChange = (e) => {
    setPassword(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission
  };

  return (
    <section className="vh-100" style={{ marginTop: '50px', marginBottom: '15px' }}>
      <div className="container py-5 h-100">
        <div className="row d-flex justify-content-center align-items-center h-100">
          <div className="col-12 col-md-8 col-lg-6 col-xl-5">
            <div className="card bg-dark text-white" style={{ borderRadius: '1rem' }}>
              <div className="card-body p-5 text-center">
                <div className="mb-md-5 mt-md-3 pb-5">
                  <h2 className="fw-light mb-2 text-uppercase">Login</h2>
                  <p className="lead text-muted mb-5">Please enter your login and password!</p>
                  <form onSubmit={handleSubmit}>
                    <div>
                  <label className="labels" htmlFor="typeEmailX">
                        Email:
                      </label>
                      <input
                        type="email"
                        id="typeEmailX"
                        className="form-control form-control-lg input"
                        value={email}
                        onChange={handleEmailChange}
                      />
                      </div>
                     
                   <div>
                     <label className="labels" htmlFor="typePasswordX">
                        Password
                      </label>
                      <input
                        type="password"
                        id="typePasswordX"
                        className="form-control form-control-lg input"
                        value={password}
                        onChange={handlePasswordChange}
                      />
                      </div>
                    <button className="button" type="submit">
                      Login
                    </button>
                  </form>
                  <div className="d-flex justify-content-center text-center mt-4 pt-1">
                    <a href="#!" className="text-white">
                      <i className="fab fa-facebook-f fa-lg"></i>
                    </a>
                    <a href="#!" className="text-white">
                      <i className="fab fa-twitter fa-lg mx-4 px-2"></i>
                    </a>
                    <a href="#!" className="text-white">
                      <i className="fab fa-google fa-lg"></i>
                    </a>
                  </div>
                </div>
                <div>
                  <p className="mb-0 up">
                    Don't have an account?{' '}
                    <a href="/signup" className="button">
                      Sign Up
                    </a>
                  </p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}

export default Login;
